export function add21(a: number, b: number): number {
  return a + b;
}

export function subtract21(a: number, b: number): number {
  return a - b;
}

export function multiply21(a: number, b: number): number {
  return a * b;
}

export function divide21(a: number, b: number): number {
  return a / b;
}
